import { Component, OnInit} from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})

export class AppComponent implements OnInit {

  id:number;
  datos: any;
  http: HttpClient;

  constructor() {

  }

  getData(): void {
    this.http.get(`http://localhost:3000/api/v1/person/${this.id}`).subscribe(data => this.datos = data);
  }

  ngOnInit() {

  }
  title = 'Express Server Test Frontend';
}
